import React from 'react';
import { useEncryption } from '../../hooks/useEncryption';

const SecureLink = ({ to, children, className, ...props }) => {
  const { encrypt } = useEncryption();
  
  const handleClick = (e) => {
    e.preventDefault();
    const encryptedUrl = encrypt(to);
    window.location.href = `/-redirect?token=${encodeURIComponent(encryptedUrl)}`;
  };

  return (
    <a href={to} onClick={handleClick} className={className} {...props}>
      {children}
    </a>
  );
};

export default SecureLink;
